/**
 * Created by akshay on 20/1/20.
 */
import React, {Component} from 'react';
import PermissionCheck from '../../Utils/PermissionCheck';
import MenuComponent from '../General/MenuComponent';
import '../../App.css';

class FooterComponent extends Component {


    render() {
        return (

            <footer className="site-footer">
                <div className="container">
                    <div className="row">
                        <div className="col-sm-12 col-md-6">
                            <p className="text-justify">freshtrack.com
                                <i>PantryTrak by Mark H. Mollenkopf is licensed under a Creative Commons Attribution-ShareAlike 3.0 Unported License.</i>
                            </p>
                        </div>
                    </div>
                </div>
                <div className="container">
                    <div className="row">
                        <div className="col-md-8 col-sm-6 col-xs-12">
                            <p className="copyright-text">PantryTrak is being developed and supported through the leadership of Mid-Ohio Foodbank, for more information please contact Mark Mollenkopf, mmollenkopf at midohiofoodbank.org, or call 614-317-9450.
                                <a href="#">PantryTrak</a>.
                            </p>
                        </div>
                    </div>
                </div>
            </footer>
        )
    }
}
export default FooterComponent ;
